import React from "react";
import Navbar from "../Navbar/Navbar";
import Box from '@mui/material/Box';

export default function Users() {
    return (
        <div>
            <Box sx={{ display: "flex" }}>
                <Navbar />
                <div> Users </div>
            </Box>
        </div>
    )
}
